function App() {
    return (
    <div className="App">
      <h1>My search engine</h1>
      <form className="search-input">
        <input type="search" placeholder="Type search query"/>
      </form>
      <div className="search-results">
        <div className="single-result">
            <h3>Search result</h3>
            <p>
                Your search results
            </p>
        </div>
      </div>
    </div>
  );
}

export default App;
